import React, {Component} from "react";
import {Text, View, StyleSheet, TextInput, Image, Dimensions, ScrollView, TouchableOpacity, FlatList} from "react-native";
import MyNavigationBar from '../component/MyNavigationBar'
import MyStatusBar from "../component/MyStatusBar";
import {gViewStyles} from "../style/ViewStyles";
import httpApi from "../tools/Api";

export default class Publish extends Component {

    constructor(props) {
        super(props);
        this.state = {
            imageArr: [1, 2, 3],
        };
    }

    // 发布帖子
    onPublish = async () => {

        // this.getUrlBase64('../source/camera.jpg', 'png', function (base64Img) {
        //     console.log('----------------base64img', base64Img);
        // })

        let imageArrStr = '';
        for (let i = 0; i < this.state.imageArr.length; i++) {
            let subImgStr = 'image' + i + '=' + 'data:image/png;base64,' + '&';
            imageArrStr+=subImgStr;
        }

        let params = imageArrStr + 'post_content=2&post_cate_id=iphone&post_position=北京&post_type=1&'
        let res = await httpApi.httpPostWithParamsStr("http://dd.shenruxiang.com/api/v1/post_send", params);
        if (res.status == 0) {
            alert("发布成功！")
        } else {
            alert("网络异常！请检查网络！");
        }

    }

    // 选择照片
    onSelectImg = () => {
        alert('选择照片');
    }

    // 删除照片
    deleteImg = () => {
        alert('删除照片');
    }

    /**
     *
     * @param url 图片路径
     * @param ext 图片格式
     * @param callback 结果回调
     */
    getUrlBase64 = (url, ext, callback) => {
        var canvas = document.createElement("canvas");   //创建canvas DOM元素
        var ctx = canvas.getContext("2d");
        var img = new Image;
        img.crossOrigin = 'Anonymous';
        img.src = url;
        img.onload = function () {
            canvas.height = 60; //指定画板的高度,自定义
            canvas.width = 85; //指定画板的宽度，自定义
            ctx.drawImage(img, 0, 0, 60, 85); //参数可自定义
            var dataURL = canvas.toDataURL("image/" + ext);
            callback.call(this, dataURL); //回掉函数获取Base64编码
            canvas = null;
        };
    }

    render() {
        return (
            <View style={gViewStyles.rootViewContainer}>
                <MyStatusBar/>
                <MyNavigationBar
                    title={'动态发布'}
                    hiddenBack={true}
                ></MyNavigationBar>
                <ScrollView style={styles.scorllviewContainer}>
                    <TextInput
                        placeholder={'输入你想说的话。。。'}
                        placeholderTextColor={gColor.grayTextColor}
                        underlineColorAndroid={'transparent'}
                        style={styles.textInput}
                        multiline={true}
                    />

                    <FlatList
                        ListHeaderComponent={this.selectImgView}
                        data={this.state.imageArr}
                        renderItem={this.imgItemView}
                        horizontal={true}
                    >
                    </FlatList>


                    <View style={styles.line1}></View>

                    {/*选择分类*/}
                    <View style={styles.subContainer}>
                        <Image source={require('../source/分类.png')} style={styles.itemIcon}/>
                        <Text style={styles.itemText}>选择分类</Text>
                        <Text style={styles.itemText1}>默认发布到最新板块</Text>
                        <Image source={require('../source/右箭头.png')} style={styles.itemArrow}/>
                    </View>

                    <View style={styles.line1}></View>

                    {/*选择定位*/}
                    <View style={styles.subContainer}>
                        <Image source={require('../source/定位.png')} style={styles.itemIcon}/>
                        <Text style={styles.itemText}>选择定位</Text>
                        <Text style={styles.itemText1}>确认定位已开启</Text>
                        <Image source={require('../source/右箭头.png')} style={styles.itemArrow}/>
                    </View>

                    <View style={styles.line1}></View>

                    {/*确认发布*/}
                    <View style={styles.subContainer1}>
                        <TouchableOpacity onPress={()=>this.onPublish()}>
                            <View style={styles.backView}>
                                <Text style={styles.text7}>确认发布</Text>
                            </View>
                        </TouchableOpacity>
                    </View>
                </ScrollView>
            </View>
        );
    };

    imgItemView = ({item, index}) => {
        return(
            <TouchableOpacity onPress={()=>this.deleteImg()}>
                <Image source={require('../source/广告4.jpg')} style={styles.selectImg}/>
            </TouchableOpacity>
        );
    }

    selectImgView = ({}) => {
        return(
            <TouchableOpacity onPress={() => this.onSelectImg()}>
                <Image source={require('../source/camera.jpg')} style={styles.selectImg}/>
            </TouchableOpacity>
        );
    }

}

